"use strict";(self.webpackChunkdirectdesignlab_github_io=self.webpackChunkdirectdesignlab_github_io||[]).push([[422],{422:s=>{s.exports=JSON.parse('[{"id":"1","title":"Sample Type-Thon Topic 1","images":[{"src":"/assets/svgs/1_script_fusion/ccheon1.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc575\uae00\ub85c-\uc0c9\uc2a8\ud615 \ub8ec \ubb38\uc790\ub97c \ubaa8\ud2f0\ube0c\ub85c \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud558\uc600\uc2b5\ub2c8\ub2e4. \ub8ec \ubb38\uc790\ub294 \uc138\ub85c\ud68d\uacfc \ub300\uac01\uc120\ud68d\uc774 \uc5f0\uacb0\ub41c \uae30\ud558\ud559\uc801 \ud615\ud0dc\uc640 \uc9c1\uc0ac\uac01\ud615 \ud2c0 \uc548\uc5d0\uc11c \ub9cc\ub4e4\uc5b4\uc9c0\ub294 \ub3c5\ud2b9\ud55c \uad6c\uc870\uac00 \ud2b9\uc9d5\uc785\ub2c8\ub2e4. \uc774\ub97c \ud55c\uae00 \uc11c\uccb4\ub85c \ubcc0\ud658\ud558\ub294 \uacfc\uc815\uc5d0\uc11c, \ub8ec \ubb38\uc790\uc758 \uc77c\uc815\ud55c \ub450\uaed8\uc640 \uc120\ub4e4\uc774 \ub9cc\ub098\ub294 \uacf5\uac04\uc801 \ud615\ud0dc\ub97c \ucc38\uace0\ud558\uc5ec \uc138\ub85c\ub85c \uae34 \uc9c1\uc0ac\uac01\ud615 \ud2c0 \uc548\uc5d0\uc11c \uc77c\uad00\uc131\uc744 \uc720\uc9c0\ud558\ub3c4\ub85d \uc124\uacc4\ud558\uc600\uc2b5\ub2c8\ub2e4. \ub8ec \ubb38\uc790\ub294 \uac04\uacb0\ud55c \uc2ec\ubcfc\ucc98\ub7fc \ubcf4\uc774\uc9c0\ub9cc, \ud55c\uae00\uc740 \ud68d\uc774 \ub9ce\uc544 \ubcf5\uc7a1\ud574 \ubcf4\uc77c \uc218 \uc788\ub2e4\ub294 \uc810\uc744 \uace0\ub824\ud588\uc2b5\ub2c8\ub2e4. \uc774\uc5d0 \ub530\ub77c, \ud68d\uc744 \ucd5c\uc18c\ud654\ud558\uba74\uc11c\ub3c4 \ud55c\uae00 \uace0\uc720\uc758 \ud2b9\uc9d5\uc744 \uc720\uc9c0\ud558\ub3c4\ub85d \ub514\uc790\uc778\ud558\uc600\uace0, \uac01 \ud68d\uc744 \uc5f0\uacb0\ud558\uc5ec \ub8ec \ubb38\uc790\uc758 \uacf5\uac04\uc801 \ud2b9\uc9d5\uacfc \uc870\ud654\ub97c \uc774\ub8e8\ub294 \uc11c\uccb4\ub97c \uc644\uc131\ud558\uc600\uc2b5\ub2c8\ub2e4."},{"id":"2","title":"Sample Type-Thon Topic 2","images":[{"src":"/assets/svgs/1_script_fusion/hjung1.svg","alt":"Description of image 2","style":"style2"}],"description":"\uc704\uad6c\ub974\uc5b4 \ubb38\uc790\ub97c \ubaa8\ud2f0\ube0c\ub85c \uc0bc\uc544 \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uc704\uad6c\ub974\uc5b4\ub294 \uc790\ubaa8\uc74c\uc744 \uc870\ud569\ud558\uc9c0 \uc54a\uace0 \ub098\uc5f4\ud558\ub294 \ubc29\uc2dd\uc73c\ub85c \ubc30\uce58\ub418\ub294 \ud2b9\uc9d5\uc774 \uc788\uc73c\uba70, \uad6c\ubd88\uad6c\ubd88\ud55c \uace1\uc120\uc774 \uc790\uc8fc \ub098\ud0c0\ub0a9\ub2c8\ub2e4. \ub610\ud55c, \ud55c\uae00\uc5d0\uc11c\ub294 \ubcf4\uae30 \uc5b4\ub824\uc6b4 \uac00\ub85c\ub85c \uc774\uc5b4\uc9c0\uace0 \uae38\ucb49\ud55c \ube44\uc728\uc774 \ub3cb\ubcf4\uc774\uba70, \uac15\uc870\ub098 \uc545\uc13c\ud2b8\ub97c \uc758\ubbf8\ud558\ub294 \uae30\ud638\ub4e4\uc774 \uc801\uadf9\uc801\uc73c\ub85c \uc0ac\uc6a9\ub41c \uc810\uc774 \ub9e4\ub825\uc801\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \ub514\uc790\uc778 \uacfc\uc815\uc5d0\uc11c \uc704\uad6c\ub974\uc5b4\uc758 \ubd84\uc704\uae30\ub97c \uc0b4\ub9ac\uae30 \uc704\ud574 \uc911\uac04\uc120\uc744 \uae30\uc900\uc73c\ub85c \uc5b4\uc13c\ub354\uc640 \ub514\uc13c\ub354 \ub77c\uc778\uc744 \uc124\uc815\ud558\uc5ec \ud55c\uae00\uc758 \uac00\ub3c5\uc131\uc744 \ub192\uc774\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ub744\uc5b4\uc4f0\uae30\ub97c \uc0dd\ub7b5\ud558\uc5ec \uae34 \uac00\ub85c\uc758 \ub290\ub08c\uc744 \ubd80\uac01\uc2dc\ucf30\uc2b5\ub2c8\ub2e4. \uc704\uad6c\ub974\uc5b4\uc758 \ud2b9\uc9d5\uc778 \uc810\uacfc \uafb8\ubc08\uae30\ud638\ub294 \uac01 \uae00\uc790\uc758 \ub05d\uc9c0\uc810\uc5d0 \ucd94\uac00\ud588\uc73c\uba70, \uc2e4\uc81c \uae00\uaf34\uc744 \uc81c\uc791\ud560 \uacbd\uc6b0 \uc774\ub97c \uc704\ud55c \uaddc\uce59\uc744 \uc124\uc815\ud574\uc57c\uaca0\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4."},{"id":"3","title":"Sample Type-Thon Topic 3","images":[{"src":"/assets/svgs/1_script_fusion/ian1.svg","alt":"Description of image 1","style":"style1"}],"description":"\ubabd\uace8\uc758 \'Soyombo script\' \ubb38\uc790\ub97c \ubaa8\ud2f0\ube0c \uc0bc\uc544 \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uc790\ubaa8\uc74c \uc870\ud569 \ubc29\uc2dd\uc774 \ud55c\uae00\uacfc \uc720\uc0ac\ud558\uc9c0\ub9cc \ud6e8\uc52c \ubcf5\uc7a1\ud558\ub2e8 \uc810\uc5d0\uc11c \uc0c8\ub85c\uc6b4 \ud55c\uae00\uc744 \ubc1c\uacac\ud560 \uc218 \uc788\uc744 \uac83 \uac19\uc558\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 \uc18c\uc6a4\ubcf4 \ubb38\uc790\uc758 \uc0c1\ub2e8\ubd80 \uc790\uc74c\uc740 \uad04\ud638\uc640 \uac19\uc740 \uae30\ud638\uc758 \ud615\ud0dc\uc640 \uc720\uc0ac\ud558\uae30 \ub54c\ubb38\uc5d0 \uc774\ub97c \ud55c\uae00\uc5d0 \uc801\uc6a9\uc2dc\ud0a4\uba74, \ub9d0\ud22c\uc640 \uc9c0\uc5ed\ubcc4 \uc0ac\ud22c\ub9ac \ub4f1\uc744 \uae00\uc790\uc5d0 \ub2f4\uc544\ub0bc \uc218 \uc788\uaca0\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4. \ub514\uc790\uc778\ud560 \ub550 \uc138\ub85c\uc120\uacfc \uc0c1\ub2e8\ubd80 \uc0bc\uac01\ud615\uc73c\ub85c \uc774\ub904\uc9c4 \uc18c\uc6a4\ubcf4 \ubb38\uc790\uc758 \uae30\ubcf8 \uace8\uaca9\uc744 \uc720\uc9c0\ud558\ub824 \ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c \uaddc\uce59\uc131\uc774 \ub9e4\uc6b0 \uc801\uc740 \uc18c\uc6a4\ubcf4 \uc54c\ud30c\ubcb3\uc758 \ud615\ud0dc\uc801 \uc694\uc18c\ub97c \uc801\uc808\ud788 \ub179\uc5ec\ub0b4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4."},{"id":"4","title":"Sample Type-Thon Topic 4","images":[{"src":"/assets/svgs/1_script_fusion/yewon1.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc778\ub3c4\uacc4 \uc5b8\uc5b4\uc758 \uc870\uc0c1 \uaca9\uc778 \uc0b0\uc2a4\ud06c\ub9ac\ud2b8\uc5b4\ub97c \ubaa8\ud2f0\ube0c\ub85c \ud55c\uae00 \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uc0b0\uc2a4\ud06c\ub9ac\ud2b8\uc5b4\ub294 \ub2e8\uc5b4 \ub0b4\ubd80\uc5d0\uc11c \uc0c1\ub2e8\uc758 \ud68d\uc774 \uac00\ub85c\ub85c \uae38\uac8c \ubed7\uc5b4 \ubaa8\ub4e0 \uc74c\uc6b4\uc744 \uc5f0\uacb0\ud558\ub294 \uac83\uc774 \ud2b9\uc9d5\uc785\ub2c8\ub2e4. \uc774 \uc0c1\ub2e8 \ud68d\uc740 \ube44\uad50\uc801 \ubcf5\uc7a1\ud55c \uc0b0\uc2a4\ud06c\ub9ac\ud2b8\uc5b4\uc5d0 \ud1b5\uc77c\uac10\uc744 \ubd80\uc5ec\ud558\uba70, \uc218\ud3c9\uc73c\ub85c \ubed7\uc740 \uc0c1\ub2e8 \ud68d\uc5d0\uc11c \ud30c\uc0dd\ub41c \uc218\uc9c1 \ud68d\uc740 \uc218\uc9c1\xb7\uc218\ud3c9\uc801 \uc9c8\uc11c\ub97c \ub354\ud574\uc90d\ub2c8\ub2e4. \uc774\ub7ec\ud55c \ud2b9\uc9d5\uc744 \ud55c\uae00 \uc11c\uccb4\uc5d0 \uc801\uc6a9\ud558\uba74, \ud55c \uae00\uc790 \uc548\uc5d0 \uc790\uc74c, \ubaa8\uc74c, \ubc1b\uce68\uc744 \ud3ec\ud568\ud574\uc57c \ud574 \ubcf5\uc7a1\ud558\uba70, \ud544\uae30 \uc2dc \uc54c\ud30c\ubcb3\uc5d0 \ube44\ud574 \ub192\ub0ae\uc774\ub97c \uade0\uc77c\ud558\uac8c \ub9de\ucd94\uae30 \uc5b4\ub835\ub2e4\ub294 \ud55c\uae00\uc758 \ud2b9\uc131\uc744 \ubcf4\uc644\ud560 \uc218 \uc788\uc744 \uac83\uc774\ub77c \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \uc0b0\uc2a4\ud06c\ub9ac\ud2b8\uc5b4\uc758 \uc544\ub984\ub2e4\uc6c0 \uc911 \ud558\ub098\uc778 \uc720\ub824\ud55c \uace1\uc120\uacfc \uc9c1\uc120\uc758 \ub300\ube44\uac10\uc744 \ucc28\uc6a9\ud574, \ud55c\uae00 \uc11c\uccb4\uc640 \uc870\ud654\ub97c \uc774\ub8e8\ub3c4\ub85d \ub514\uc790\uc778\ud558\uc600\uc2b5\ub2c8\ub2e4."},{"id":"5","title":"Sample Type-Thon Topic 5","images":[{"src":"/assets/svgs/1_script_fusion/yujin1.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc870\uc9c0\uc544\uc5b4\ub97c \ubaa8\ud2f0\ube0c\ub85c \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uc870\uc9c0\uc544\uc5b4\ub294 \ud06c\uac8c \u2018\uc544\uc19c\ud0c0\ube0c\ub8f0\ub9ac\u2019, \u2018\ub204\uc2a4\ud6c4\ub9ac\u2019, \u2018\ubbc0\ud5e4\ub4dc\ub8f0\ub9ac\u2019 \uc138 \uc885\ub958\ub85c \ub098\ub258\uba70, \uc800\ub294 \ud604\ub300 \uc870\uc9c0\uc544\uc5b4\uc5d0\uc11c \uc8fc\ub85c \uc0ac\uc6a9\ub418\ub294 \u2018\ubbc0\ud5e4\ub4dc\ub8f0\ub9ac\u2019\ub97c \uc911\uc810\uc801\uc73c\ub85c \ud65c\uc6a9\ud588\uc2b5\ub2c8\ub2e4. \ubbc0\ud5e4\ub4dc\ub8f0\ub9ac\ub294 \uac04\uacb0\ud558\uace0 \uc6b0\uc544\ud55c \uace1\uc120, \uc704\uc544\ub798\ub85c \uae38\uac8c \ubed7\uc740 \uc138\ub85c\ud68d, \uadf8\ub9ac\uace0 \ud070 x-height\uac00 \ud2b9\uc9d5\uc73c\ub85c, \uc774\ub7ec\ud55c \uc870\ud615\uc801 \ub9e4\ub825\uc774 \ub9e4\uc6b0 \uc778\uc0c1\uc801\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \ud2b9\ud788, x-height\uac00 \uc77c\uc815\ud55c \uac04\uaca9\uc73c\ub85c \ub098\uc5f4\ub418\uc5b4 \uc788\uc5b4 \uc815\ub3c8\ub41c \ub290\ub08c\uc744 \uc90d\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uc870\uc9c0\uc544\uc5b4 \uc54c\ud30c\ubcb3\uc758 \ud2b9\uc9d5\uc744 \uc0b4\ub9ac\uae30 \uc704\ud574, \ud55c\uae00 \uc11c\uccb4\ub97c \uc791\uc5c5\ud560 \ub54c \u2018\u3131\u2019, \u2018\u3155\u2019, \u2018\u314e\u2019, \u2018\u314f\u2019\uc758 \uc6d0\ud615 \ud68d\uc758 \ubca0\uc774\uc2a4\ub77c\uc778\uc744 \uc77c\uce58\uc2dc\ucf30\uc73c\uba70, \uae00\uc790 \uac04\uaca9 \ub610\ud55c \ub3d9\uc77c\ud558\uac8c \uc870\uc815\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \uc704\uc544\ub798\ub85c \uae38\uac8c \ubed7\uc5b4 \ub098\uac00\ub294 \ud68d\uc744 \ud65c\uc6a9\ud574 \uc790\uc74c\uacfc \ubaa8\uc74c\uc758 \ud615\ud0dc\uac00 \ub124\ubaa8\uaf34\uc744 \ubc97\uc5b4\ub098\ub3c4\ub85d \ud45c\ud604\ud588\uc2b5\ub2c8\ub2e4."},{"id":"6","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/1_script_fusion/yunoo1.svg","alt":"Description of image 1","style":"style3"}],"description":"\uace0\ub300 \uc774\uc9d1\ud2b8 \uc0c1\ud615\ubb38\uc790\ub97c \ubaa8\ud2f0\ube0c\ub85c \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \ud30c\ud53c\ub8e8\uc2a4 \ud544\uae30\uccb4\uc758 \uc587\uace0 \ub610\ub837\ud55c \ud615\ud0dc\uc640 \uc0c1\ud615\ubb38\uc790\uc758 \uc138\ub85c \ubc29\ud5a5 \uad6c\uc870, \ub124\ubaa8\uaf34 \uc870\ud615\ubbf8\uc5d0 \ub9e4\ub825\uc744 \ub290\uaef4 \uc774\ub97c \ud55c\uae00 \uc11c\uccb4 \ub514\uc790\uc778\uc5d0 \ubc18\uc601\ud588\uc2b5\ub2c8\ub2e4. \uc0c1\ud615\ubb38\uc790\ub294 \uc9e7\uc740 \uc138\ub85c \ube44\uc728\uacfc \uc7a5\uc2dd\uc801\uc778 \uc120 \uad6c\uc870\ub97c \ud1b5\ud574 \ub9ce\uc740 \ubb38\uc790\ub97c \uc870\ubc00\ud558\uac8c \ub2f4\ub294 \ud2b9\uc9d5\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \ubc14\ud0d5\uc73c\ub85c \ud55c\uae00\uc758 \uc790\uc74c\uacfc \ubaa8\uc74c\uc744 \ub124\ubaa8\uaf34 \uc548\uc5d0\uc11c \uc870\ud654\ub86d\uac8c \ubc30\uce58\ud558\ub3c4\ub85d \uc124\uacc4\ud588\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 \uc790\uc74c\uacfc \ubaa8\uc74c \uac04\uc758 \uac04\uaca9\uc744 \uc870\uc815\ud574 \uade0\ud615 \uc7a1\ud78c \ubc00\ub3c4\ub97c \uc720\uc9c0\ud558\uace0, \uc0c1\ud615\ubb38\uc790\uc758 \uac00\ub85c\ub85c \uae38\uac8c \uc774\uc5b4\uc9c0\ub294 \uc120 \uad6c\uc870\ub97c \uc790\uc74c\uc5d0 \ubc18\uc601\ud588\uc2b5\ub2c8\ub2e4. \ubaa8\uc74c\uc5d0\ub294 \uc0c1\ud615\ubb38\uc790\uc758 \uc138\ub85c\ub85c \uc9e7\uace0 \ubd88\uaddc\uce59\uc801\uc778 \uc120\uc744 \ud65c\uc6a9\ud574 \uc7a5\uc2dd\uc801\uc778 \uc694\uc18c\ub97c \ub354\ud588\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \ub514\uc790\uc778 \uacfc\uc815\uc5d0\uc11c \ud544\uae30\uccb4 \ud2b9\uc720\uc758 \uade0\uc77c\ud558\uba74\uc11c\ub3c4 \uc790\uc5f0\uc2a4\ub7ec\uc6b4 \ub300\ube44\uac10\uc744 \uc720\uc9c0\ud558\ub824 \ub178\ub825\ud588\uc73c\uba70, \uc0c1\ud615\ubb38\uc790\uc758 \uc870\ud615\ubbf8\uc640 \ud55c\uae00\uc758 \uad6c\uc870\uc801 \ud2b9\uc9d5\uc744 \uc870\ud654\ub86d\uac8c \uacb0\ud569\ud55c \uc11c\uccb4\ub97c \uc644\uc131\ud588\uc2b5\ub2c8\ub2e4."}]')}}]);